import React from "react";

import CustomLink from "../customLink/customLink";

const BackLine = () => {
  return (
    <div className="line-back">
      <CustomLink>
        <p>&larr;</p>
        <p>Back</p>
      </CustomLink>
    </div>
  );
};

export default BackLine;
